import React, { useEffect, useState} from 'react';
import axios from "axios";

import{Tab, Tabs,TabPanel,  Button, Box} from '@mui/material'
import HomePage from "./HomePage";
import {Link} from "react-router-dom";
export default
function Dashboard(){
const[value, setv] = useState('1')
const [isAuth, setIsAuth] = useState(false)
    const panes = [

        {
            menuItem: 'Ticket',
        },
        {
            menuItem: 'Schedule',
        },
        {
            menuItem: 'UserStatistics',
        },
        {
            menuItem: 'Room Management',
        },
        {
            menuItem: 'Account',
        },
        {
            menuItem: 'List of Users',
        }
    ]

    return (<div>
    <h1>Logo</h1>
<Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
 <Tabs value={value}

         textColor="secondary"
         indicatorColor="secondary"variant="fullWidth"  orientation= 'vertical'>
      <Tab value= '1' label= 'User'/>
      <Tab value ='2' label = 'Ticket' />
 </Tabs>
</Box>
      </div>);

}
